import React from 'react';

const Navbar = ({scrollToHome, scrollToAboutMe, scrollToPortfolio, scrollToContact}) => {
    return(
            <header className="fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
              <nav className="f6 fw6 ttu tracked">
                <ul className = 'nav-items'>
                    <li onClick = {scrollToHome} className="link dim mid-gray dib mr3 pointer">home</li>
                    <li onClick = {scrollToAboutMe} className="link dim mid-gray dib mr3 pointer">about</li>
                    <li onClick = {scrollToPortfolio} className="link dim mid-gray dib mr3 pointer">portfolio</li>
                    <li onClick = {scrollToContact} className="link dim mid-gray dib mr3 pointer fr">contact</li>
                </ul>
              </nav>
            </header>
 );
}

export default Navbar;
